-- Generates a node object that can be added to the mesh.
function Mesh:CreateNode( type, x, y, map )
	if not NodeTypes[type] then
		return;
	end
	local node = setmetatable({X=x,Y=y,Map=m}, NodeTypes[type]);
end

function Mesh:AddLink( type, node, neighbor, cost )
	if not ( node and neighbor and LinkTypes[type] ) then
		return;
	end
	-- TODO: check that link is not slower than an existing link from the same node.
	tinsert(neighbor, setmetatable({ -- store in neighbor, makes it an incoming-link mesh.
		Source = node, -- TODO: drop labels for int indexed table to save memory.
		Destination = neighbor,
		Cost = cost,
		Type = type
	}, LinkTypes[type]));
end

