function Mesh:Build()
	
	-- Flight Paths
	if self.FlightPathData then
		-- Add flightpaths to mesh.
		local fpNodes = {};
		for npc, data in pairs(self.FlightPathData) do
			local faction, name, x, y, map = unpack(data);
			if true then -- TODO: Flight path is available to players faction.
				x,y = MapData:Translate( x, y, map, 0 ); -- TODO: hard code translation
				-- TODO: hard code zone
				local node = self:CreateNode('FlightMaster',x,y,map);
				if node then
					node.NPC = npc;
					node.Name = name;
					tinsert(self.Mesh,node);
					fpNodes[npc] = node;
				end
			end
		end
		
		-- Link flightpaths.
		for npc, node in pairs(fpNodes) do -- loop nodes for flightpaths not excluded.
