-- Inverse A* Search
-- Calculates shortest path to the goal for every node.
Mesh.Path = {};
Mesh.Scores = {};
function Mesh:Scan(goal)
	local open = {};
	local path = {};
	local scores = {[goal] = 0};
	local node = goal;
	while node do
		open[node] = nil;
		for i = 1, #node do -- loop through nodes neighbors/links(incoming).
			local link = node[i];
			local n = link.Source; -- neighbor node
			local score = scores[node]+link.Cost; -- cost of reaching the goal from this neighbor.
			if (not scores[n]) or score < scores[n] then -- this is the cheapest known route to the goal.
				path[n] = link;
				scores[n] = score;
				open[n] = true;
			end
		end
		node = next(open); -- TODO: check that this is working fine.
		-- IE not picking a slow node and scanning the whole tree, then picking a slightyly faster node and scanning it all over again, etc
		-- if it's not functioning well replace it with a double nested loop so we can control iterrations.
	end
	return path, scores;
end

