		return;
	end
	
	local goal = self:CreateNode( "Do Things", x, y, map, floor );
	-- TODO: add walking connections from maps other nodes
	
	local path, scores = self:Scan(goal);
	
	-- find best entry node
	local node = nil;
	local low = nil;
	for n, score in pairs(scores) do
		if n.Map == PlayerInfo.Map and n.Floor == PlayerInfo.Floor then
			score = score + MapData:Distance( PlayerInfo.X, PlayerInfo.Y, n.X, n.Y );
			if (not low) or score < low then
				node = n;
				low = score;
			end
		end
	end
	
	local route = {};
	for i = 1,10 do
		route[i] = path[node];
		node = path[node].Destination;
		if not path[node] then
			break
		end
	end
	return route;
end
